import React from 'react';

export default function Blogs(props) {
  return (
    <div>
      <h2>Game Blogs</h2>
      {
        props.blogs.map(blog => (
          <div key={blog.id}>
            <h4>{blog.title}</h4>
            <p>{blog.content}</p>
            <p>{blog.user_id}</p>
            <p>{props.currentUser}</p>
          </div>
        ))
      }
    </div>
  )
}
